            List<String> ints = new List<String>();
            int result = 0;

            Dictionary<string, int> keyValues = new Dictionary<string, int>()
            {
                { "one", 1 }, { "two", 2 }, { "three", 3 },
                { "four", 4 }, { "five", 5 }, { "six", 6 },
                { "seven", 7 }, { "eight", 8 }, { "nine", 9 },
                { "zero", 0 }
            };

            string[] substrings = input.Split(new string[] { "\r\n" }, StringSplitOptions.RemoveEmptyEntries);

            Dictionary<int, int> keyValue_postion = new Dictionary<int, int>();

            foreach (string s in substrings)
            {
                int counter_for_keys = 0;

                foreach (var keyValue in keyValues)
                {
                    if (s.Contains(keyValue.Key))
                    {
                        int count = s.Split(new[] { keyValue.Key }, StringSplitOptions.None).Length - 1;
                        keyValue_postion.Add(s.IndexOf(keyValue.Key), keyValues[keyValue.Key]);
                        counter_for_keys = s.IndexOf(keyValue.Key);
                        while (count != 1)
                        {
                            int current_pos = s.IndexOf(keyValue.Key, counter_for_keys + 1);
                            keyValue_postion.Add(s.IndexOf(keyValue.Key, current_pos), keyValues[keyValue.Key]);
                            counter_for_keys = current_pos;
                            count--;
                        }
                    }
                }

                int counter_for_numbers = 0;

                foreach (char c in s)
                {
                    if (Char.IsNumber(c))
                    {
                        keyValue_postion.Add(s.IndexOf(c, counter_for_numbers), Int32.Parse(c + ""));
                    }
                    counter_for_numbers++;
                }

                if (keyValue_postion.Keys.Any())
                {
                    int value_min;
                    int value_max;
                    keyValue_postion.TryGetValue(keyValue_postion.Keys.Min(), out value_min);
                    keyValue_postion.TryGetValue(keyValue_postion.Keys.Max(), out value_max);
                    ints.Add(value_min + "" + value_max);
                }
                keyValue_postion.Clear();
            }

